        fetch('https://jsonplaceholder.typicode.com/todos/1')
        .thrn(response=>response.js)
    }, [])
    

    
    if (data === false) {
        return <h1>Loading...</h1>
    } else {
        return <h1>We got the Data from fetching {data.toString()}</h1>
    }


}
